#pragma mark Generated Images

+ (UIImage*)imageOfEarth;
{
    if (_imageOfEarth)
        return _imageOfEarth;

    UIGraphicsBeginImageContextWithOptions(CGSizeMake(320, 320), NO, 0.0f);
    [ImageFilterStyleKit drawEarth];
    _imageOfEarth = UIGraphicsGetImageFromCurrentImageContext();
    UIGraphicsEndImageContext();

    return _imageOfEarth;
}

#pragma mark Customization Infrastructure

- (void)setEarthTargets: (NSArray*)earthTargets
{
    _earthTargets = earthTargets;

    for (id target in self.earthTargets)
        [target setImage: ImageFilterStyleKit.imageOfEarth];
}


